import { BrowserRouter, Route, Routes } from 'react-router-dom';
import './App.css';

function App() {
  return (
    <BrowserRouter>
      <div className="App">

        <Route>
          <h1>Home</h1>
        </Route>
      </div>
      ;
    </BrowserRouter>
  );
}

export default App;
